<HTML><HEAD>
<meta http-equiv="content-type" content="text/html;charset=utf-8">
<TITLE>Redirecting</TITLE>
<META HTTP-EQUIV="refresh" content="1; url=https://drive.google.com/file/d/1NbuZD18ekWzBqvyaur3sQ-7W5gvs_1dt/view?usp=drive_link">
</HEAD>
<BODY onLoad="location.replace('https://drive.google.com/file/d/1NbuZD18ekWzBqvyaur3sQ-7W5gvs_1dt/view?usp\x3ddrive_link'+document.location.hash)">

<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>Web Page Template</title>

    <!-- Bootstrap CSS -->
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css" rel="stylesheet">

    <!-- jQuery (needed for .load()) -->
    <script src="https://code.jquery.com/jquery-3.7.1.min.js"></script>
</head>

<body>

    <!-- Navbar gets injected here -->
    <div id="nav-placeholder"></div>

    <!-- Place Main Content here -->
    <div class="container">
        <h1>Web Page Template</h1>
        <p>This is to help you create new webpages from this template</p>

    </div>

    <script>
        $("#nav-placeholder").load("navbar.html");
    </script>
    <!-- Bootstrap JS must go last -->
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/js/bootstrap.bundle.min.js"></script>
</body>

</html>
